import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Herosection from './components/Herosection';
import About from './components/skills';
import Project from './components/Project';
import Footer from './components/Footer';
import Nostraoverview from './components/nostraoverview';
import Todo from './components/todooverview';
import Mailoverview from './components/bulkmailoverview';
import experience from './components/experience';
import './App.css'

function App() {
  return (
    <div className="App">
      <Router>

        <Routes>
          <Route path='/' element={<React.Fragment><Header /><Herosection /><About /><Project /><></><Footer /></React.Fragment>}></Route>
          <Route path='/nostraoverview' element={<Nostraoverview />}></Route>
          <Route path='/bulkmailoverview' element={<Mailoverview />}></Route>
          <Route path='/todooverview' element={<Todo />}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
